import React from 'react'
import {Container ,Row,Button} from 'reactstrap'
import { NavLink,Link } from "react-router-dom";

const nav_links=[
  {
    path:'/home',
    display:'home'
  },
  {
    path:'#',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },
]

function Header() {
  return (
   <header className="header">
    <Container>
      <Row>
        <div className="nav_wrapper d">

        </div>
      </Row>
    </Container>
   </header>
  )
}

export default Header
